    [],nt"num_tags": 3,nt"name": "shiawasee-flats-wildlife-management-area-narrative-report-january-april-1957",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Shiawasee National
    Wildlife Refuge outlines Refuge accomplishments from January through April of 1957.
    The report begins by summarizing the weather conditions and water conditions during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, mammals, raptors, and fish- is also covered. The
    Refuge development and maintenance section discusses plantings. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, and violations. Items of interest and N-R forms are attached.",nt"owner_org":
